use strict\";\n\n    let i = Math.max(Math.floor(cb_obj.start), 0),\n        j = Math.min(Math.ceil(cb_obj.end), source.data['ohlc_high'].length);\n\n    let max = Math.max.apply(null, source.data['ohlc_high'].slice(i, j)),\n        min = Math.min.apply(null, source.data['ohlc_low'].slice(i, j));\n    _bt_scale_range(ohlc_range, min, max, true);\n\n    if (volume_range) {\n        max = Math.max.apply(null, source.data['Volume'].slice(i, j));\n        _bt_scale_range(volume_range, 0, max * 1.03, false);\n    }\n\n}, 50);\n"},"id":"2132822","type":"CustomJS"},{"attributes":{"line_alpha":{"value":0.1},"line_color":{"field":"returns_positive","transform":{"id":"2132475"}},"line_dash":{"value":"dotted"},"line_width":{"value":8},"xs":{"field":"position_lines_xs"},"ys":{"field":"position_lines_ys"}},"id":"2132747","type":"MultiLine"},{"attributes":{},"id":"2132759","type":"Selection"},{"attributes":{},"id":"2132762","type":"UnionRenderers"},{"attributes":{"coordinates":null,"formatter":{"id":"2132477"},"group":null,"major_label_policy":{"id":"2132757"},"ticker":{"id":"2132448"},"visible":false},"id":"2132447","type":"LinearAxis"},{"attributes":{},"id":"2132537","type":"AllLabels"},{"attributes":{"label":{"value":"Peak (105%)"},"renderers":[{"id":"2132532"}]},"id":"2132549","type":"LegendItem"},{"attributes":{"coordinates":null,"formatter":{"id":"2132811"},"group":null,"major_label_policy":{"id":"2132812"},"ticker":{"id":"2132776"},"visible":false},"id":"2132775","type":"LinearAxis"},{"attributes":{},"id":"2132481","type":"DataRange1d"},{"attributes":{"axis":{"id":"2132451"},"coordinates":null,"dimension":1,"group":null,"ticker":null},"id":"2132454","type":"Grid"},{"attributes":{},"id":"2132492","type":"BasicTicker"},{"attributes":{},"id":"2132860","type":"BasicTickFormatter"},{"attributes":{"bottom":{"field":"Close"},"fill_alpha":{"value":0.2},"fill_color":{"field":"inc","transform":{"id":"2132473"}},"hatch_alpha":{"value":0.2},"line_alpha":{"value":0.2},"top":{"field":"O
